class Index_{
	private:
		int n;
		int ans[1100];
		bool used[1100];
		bool flag = false;
	public:
		void InIt();
		void dfs(int);
}index_;
int main(){index_.InIt(); return 0;}
void Index_ ::InIt(){
	scanf("%d", &this -> n);
	if(n == 1){printf("1\n"); exit(0);}
	this -> ans[1] = 1; this -> used[1] = true;
	this -> dfs(2); if(!this -> flag)printf("No Answer\n");
	this -> flag = false;
	for(int i=1; i<=1010; i++)this -> used[i]=false;
}
void Index_ ::dfs(int deep){
	if(deep > this -> n){
		if(ZS[ans[1] + ans[this -> n]]){
			for(int i=1; i<=this -> n; i++)printf("%d%c", this -> ans[i], i!=this -> n?' ':'\n');
			this -> flag = true;
		}return;
	}
	for(int i=1; i<=this -> n; i++)
		if(((deep >= 2 && ZS[this -> ans[deep - 1] + i]) || deep == 1) && !this -> used[i]){
			this -> ans[deep] = i;
			this -> used[i] = true;
			dfs(deep + 1);
			this -> used[i] = false;
		}
}
